import React from 'react';
import { Button, Container } from 'react-bootstrap';
import '../custom.css';

const Admin = () => {
	return (
		<Container className='d-flex flex-column' style={{ width: '320px' }}>
		<Button className="custom-button-admin mt-4">
			Додати новий тип
			<svg xmlns="http://www.w3.org/2000/svg" width="23" height="18" viewBox="0 0 23 18" fill="none">
				<path d="M21.5 9.00073H1.5" stroke="#EDF2EE" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" />
				<path d="M13.4336 0.967285L21.5003 8.99928L13.4336 17.0326" stroke="#EDF2EE" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" />
			</svg>
		</Button>
		<Button className="custom-button-admin mt-4">
			Додати новий бренд
			<svg xmlns="http://www.w3.org/2000/svg" width="23" height="18" viewBox="0 0 23 18" fill="none">
				<path d="M21.5 9.00073H1.5" stroke="#EDF2EE" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" />
				<path d="M13.4336 0.967285L21.5003 8.99928L13.4336 17.0326" stroke="#EDF2EE" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" />
			</svg>
		</Button>
		<Button className="custom-button-admin mt-4">
			Додати нове обладнання
			<svg xmlns="http://www.w3.org/2000/svg" width="23" height="18" viewBox="0 0 23 18" fill="none">
				<path d="M21.5 9.00073H1.5" stroke="#EDF2EE" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" />
				<path d="M13.4336 0.967285L21.5003 8.99928L13.4336 17.0326" stroke="#EDF2EE" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round" />
			</svg>
		</Button>
		</Container>
	);
};

export default Admin;
